import React from "react";
import "./Podium.css";

// Icons (network SVG links used for demo, replace with local assets as needed)
const wings = "https://cdn-icons-png.flaticon.com/512/616/616494.png";  // stylized wing icon
const goldCrown = "https://www.pngall.com/wp-content/uploads/14/King-Crown-PNG-Pic.png";
const goldTrophy = "https://cdn-icons-png.flaticon.com/512/2583/2583346.png";
const goldCoin = "https://cdn-icons-png.flaticon.com/512/616/616408.png";

// Demo: props.topThree [{avatar,name,points,userTag},...], props.theme = ("wealth"|"live"|"hourly"|"party"), props.onSelect(user)
export default function LeaderboardPodium({ topThree = [], theme="wealth", onSelect }) {
  // Default badge/coin per theme
  const getPointIcon = () => {
    if(theme==="party") return goldTrophy;
    if(theme==="hourly") return "https://cdn-icons-png.flaticon.com/128/1828/1828884.png"; // fire icon
    if(theme==="live")   return "https://cdn-icons-png.flaticon.com/128/3649/3649449.png"; // flower icon
    return goldCoin; // wealth
  };
  const pointIcon = getPointIcon();

  // Helper for 1st, 2nd, 3rd slot (for demo: always expects 3 items)
  return (
    <div className={`podium-flex podium-${theme}`}>
      {/* Second place (left) */}
      <div className="podium-card second" onClick={() => onSelect?.(topThree[1]?.userId)}>
        <img src={topThree[1]?.avatar || goldCrown} alt="" className="podium-avatar" />
        <div className="podium-badge medal silver">
          <span className="podium-number">2</span>
        </div>
        <div className="podium-user" title={topThree[1]?.name}>{topThree[1]?.name || "--"}</div>
        <div className="podium-points">
          {(topThree[1]?.points) ?? "--"}
          <img src={pointIcon} alt="" className="pt-icon"/>
        </div>
      </div>

      {/* First Place (center, gold, wings, big) */}
      <div className="podium-card first" onClick={() => onSelect?.(topThree[0]?.userId)}>
        <div className="podium-wings"><img src={wings} alt="" /></div>
        <img src={topThree[0]?.avatar || goldCrown} alt="" className="podium-avatar first" />
        <div className="podium-badge gold-crown">
          <img src={goldCrown} alt="" style={{width: 30}} />
          <span className="podium-number">1</span>
        </div>
        <div className="podium-user" title={topThree[0]?.name}>{topThree[0]?.name || "--"}</div>
        <div className="podium-points">
          {topThree[0]?.points ?? "--"}
          <img src={pointIcon} alt="" className="pt-icon"/>
        </div>
      </div>

      {/* Third place (right) */}
      <div className="podium-card third" onClick={() => onSelect?.(topThree[2]?.userId)}>
        <img src={topThree[2]?.avatar || goldCrown} alt="" className="podium-avatar" />
        <div className="podium-badge medal bronze">
          <span className="podium-number">3</span>
        </div>
        <div className="podium-user" title={topThree[2]?.name}>{topThree[2]?.name || "--"}</div>
        <div className="podium-points">
          {(topThree[2]?.points) ?? "--"}
          <img src={pointIcon} alt="" className="pt-icon"/>
        </div>
      </div>
    </div>
  );
}
